-- Let's create the database --

-- I'll be using MySQL Workbench --

CREATE DATABASE sales_data;
USE sales_data;

-- Now for the tables --

CREATE TABLE salespersons (
salesperson_id INT,
first_name VARCHAR(50),
last_name VARCHAR(50),
start_date DATE,
termination_date DATE,
tenure_in_months INT,
PRIMARY KEY(salesperson_id)
);

CREATE TABLE sold_projects (
project_id INT,
salesperson_id INT,
sold_date DATE,
sold_price INT,
sale_accuracy INT,
customer_satisfaction INT,
PRIMARY KEY(project_id),
FOREIGN KEY(salesperson_id)
REFERENCES salespersons(salesperson_id)
);

/*
The two main ways to get the data into the tables would be:
1. Using the Table Data Import Wizard
2. Using LOAD DATA INFILE

In this case, the Table Data Import Wizard would not import
the dates correctly, especially the termination_date column in
the salespersons table.

Through troubleshooting, I figured out that Excel was not
producting CSVs with proper string wrapping.

LOAD DATA INFILE returned a secure file privilege error on
all users, including the root user.

Ultimately, I made a CSV workaround in Excel:
="("&A2&","&B2&",'"&TEXT(C2,"yyyy-mm-dd")&"',"&D2&","&E2&","&F2&"),"
*/


